import React from 'react';
import { motion } from 'framer-motion';
import '../styles/LogoCarousel.css';

// SVG logos for fashion brands
const logos = [
  {
    id: 1,
    name: 'Brand One',
    svg: `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 40" width="100" height="40">
      <path d="M20,10 L30,10 L30,30 L20,30 Z" fill="#333"/>
      <path d="M35,10 L80,10 L80,15 L35,15 Z" fill="#333"/>
      <path d="M35,20 L70,20 L70,25 L35,25 Z" fill="#333"/>
    </svg>`
  },
  {
    id: 2,
    name: 'Brand Two',
    svg: `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 40" width="100" height="40">
      <circle cx="25" cy="20" r="10" fill="#333"/>
      <path d="M40,10 L80,10 L80,15 L40,15 Z" fill="#333"/>
      <path d="M40,20 L70,20 L70,25 L40,25 Z" fill="#333"/>
    </svg>`
  },
  {
    id: 3,
    name: 'Brand Three',
    svg: `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 40" width="100" height="40">
      <rect x="15" y="10" width="20" height="20" fill="#333"/>
      <path d="M45,15 L85,15 L85,25 L45,25 Z" fill="#333"/>
    </svg>`
  },
  {
    id: 4,
    name: 'Brand Four',
    svg: `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 40" width="100" height="40">
      <polygon points="20,10 30,10 25,30" fill="#333"/>
      <path d="M40,15 L80,15 L80,20 L40,20 Z" fill="#333"/>
      <path d="M40,25 L70,25 L70,30 L40,30 Z" fill="#333"/>
    </svg>`
  },
  {
    id: 5,
    name: 'Brand Five',
    svg: `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 40" width="100" height="40">
      <circle cx="20" cy="20" r="10" stroke="#333" stroke-width="2" fill="none"/>
      <path d="M35,15 L85,15 L85,20 L35,20 Z" fill="#333"/>
      <path d="M35,25 L75,25 L75,30 L35,30 Z" fill="#333"/>
    </svg>`
  },
  {
    id: 6,
    name: 'Brand Six',
    svg: `<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 100 40" width="100" height="40">
      <rect x="15" y="15" width="15" height="15" rx="2" fill="#333"/>
      <path d="M40,20 L80,20 L80,25 L40,25 Z" fill="#333"/>
    </svg>`
  }
];

const LogoCarousel = () => {
  // Duplicate logos to create seamless infinite scroll effect
  const duplicatedLogos = [...logos, ...logos];

  return (
    <div className="logo-carousel">
      <div className="logo-carousel-inner">
        <motion.div
          className="logo-track"
          animate={{
            x: ["-50%", "0%"]
          }}
          transition={{
            x: {
              repeat: Infinity,
              repeatType: "loop",
              duration: 30,
              ease: "linear"
            }
          }}
        >
          {duplicatedLogos.map((logo) => (
            <div key={`${logo.id}-1`} className="logo-item">
              <div dangerouslySetInnerHTML={{ __html: logo.svg }} />
            </div>
          ))}
        </motion.div>
      </div>
    </div>
  );
};

export default LogoCarousel;
